INSERT INTO `form_ecis` VALUES (1,518,12,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-06-28 15:25:19','2023-06-29 16:06:41'),(2,451,14,'Mi mama, mi papa, Yessenia Ortega,','N/a','Vivo solo','Soy una persona creyente pero no asisto a ninguna congregación','No','Soy publicista y me dedico a la comercialización de mi creatividad a través de experiencias','Tengo niveles académicos de maestría creatividad, estudie publicidad y mercadeo con énfasis en diseño gráfico','No pertenezco a ninguna organización solo a mi empresa, PressPlayMKT','Medicinas para el dolor de cabeza y resfriado, actualmente esroy en un trataniento para bajar de peso, en las mañanas tomo fertermina, multivitaminas, y Curcuma, antes de almuerzo y cena debo tomar un suplemento de insulina y en la noche tomo nitrato de potasio','Mido 1.80 tez clara, cabello negro, ojos oscuros, 270 libras','Pues el dinero siempre fue un problema en mi vida, mi padre como no tenia amigos recargaba sus problemas en mi.\n\nMi madre dejo de estar en mi vida a los 4 años hasta ya yo ser muy adulto\n\nNunca tuve amigos se verdad ya que cambie 12 veces de escuela','Enfocado, frívolo, inteligente, me gusta ser escuchado, gracioso, vanidoso, distraído, terco, resolutivo, bondadoso','Estoy en camino a convertirme en un productor de shows de clase mundial, es mi vision desde hace ya 5 años y cada vez estoy mas cerca de esta posibilidad.','Me gustaria dejarle al Panamá la posibilidad de vivir experiencias de clase mundial sin necesidad de tener que viajas, para mi siempre los eventos y shows internacionales en Panamá me han parecido decadentes y eso es lo que quiero hacer, revolucionar la industria del entretenimiento. Honestamente no se que diría mi familia, pero es mi sueño de vida. Mi relación con mi familia empezó a mejorar hace escasos dos años, solo espero poder brindarle a mi mama y a mi sobrina la estabilidad que se merecen para poder que estén bien','Aún busco poder conectar con personas, parte de los objetivos de la empresa es reemplazar presentaciones por conversaciones, creo que no se genera empatía sino escuchas a las personas. Y eso para mi es clave, pero quisiera poder entrar por la puerta y que me escuchen antes de hacer un juicio.','Quiero mejorar la relación con mi hermano, y mi madre, es un proceso muy largo que he tenido para aceptar y entender que mi madre solo fue madre e hizo lo que pudo con lo que tuvo. No esta bajo mi control, nunca lo estuvo','Quisiera perdonarme, soy muy duro conmigo mismo, a veces no se que quiero, mi plan es meramente empresarial, mas no existe un desarrollo como persona, por eso estoy acá.',1,'2023-07-17 19:49:27','2023-07-17 19:49:27'),(3,524,14,'Abuelos Siempre Apoyándome debido a no tener un padre por abandono \nMadre siempre luchando por mi hermano y por mí \nTíos brindando apoyo consejos \nTías siempre a mi lado de ser necesario','1 Hijo\nCarlos Esteban Guzmán Aguilar\n3 años','Katherine Esposa \nCarlos Hijo','Familia Católica de nacimiento \nLuego tías se cambiaron a cristianismo \nAmbas religiones las seguí \nCreo en Dios independientemente de religión \nSalvación personal y brindar amor a todas las personas','Ninguno','Consierge,Host o anfitrión de un Edificio \nEn la rama Área Social brindar asesoria y logística en reservaciones o cumpleaños \nBrindar siempre apoyo necesario y verificar áreas se mantengan adecuadas para uso','Escuela Conpletada\nBachiller Culmine 1 año y medio de 3 años Carrera mecánica automotriz \nUniversidad No','Ninguna','Estado Salud Actual Muy Bien\nPróximo Mes Realizaré un examen Cat para estar al pendiente de mi salud \nEsto debido a accidente en moto hace 9meses\n\nNingun Medicamento','Joven Piel trigueña \n1.65 estatura, delgado de buen vestir','Escuela aplazar un año estudio \nBachillerato abandonar mi curso debido a no tener recursos para pagarlo\nTrabajo The Velopers brindar una mano amiga en la cual ellos siempre han visto mi potencial y abrirme espacio para poder crecer con ellos.','Persona Sería cuando es necesario \nBromista en confianza \nBuenos modales\nAmoroso \nSiempre apoyando cuando se necesita','Adquirir una vivienda Propia,poder mantener una estabilidad económica buena y poder eliminar deudas \nMantener el vehículo soñado poder reunirme y compartir con toda mi familia juntos \nObtener un mayor cargo laboral','Casa propia, negoció familiar vehículo soñado \n\nÉl siempre haber confiado en mi que lo lograría y estar orgullosos de mí','Obtener Vivienda Propia\nSer constante y perseverante \nHacer todo lo posible y esforzarme \nTener ánimo y valentía de lograrlo','Vehículo \nSer constante y dedicado \nHacer cada día una posibilidad nueva de lograrlo \nTener perseverancia y valentía constante por lograrlo','Mejor puesto laboral \nSer  una persona enfocada en cada una de las cosas en mi entorno y poder crear soluciones y crecer \nHacer de mi la mejor persona y compañero para brindar mejor ambiente \nTener la capacidad de ampliar mis conocimientos y educación',1,'2023-07-17 20:16:45','2023-07-17 20:16:45'),(4,588,14,'Mis Relaciones personales más importantes desde la niñez fue mi abuela ( falleció) siempre hubo un vínculo de amor calidad de tiempo.','Adele Rueda 6años','Adele mi hija \nJuan Carlos (novio)','Mi Religión es Dios.','No','Independiente Emprendedora , ventas de productos de bienestar y salud.','Sexto año culminada , licenciatura abandonada','Ninguna','Ninguna.','Mujer, piel morena tropical ojos grandes con estatura de 1.66z nariz grande sonrisa hermosa cuerpo delgado.','Cosas que tuvieron mayor influencia sobre mis creencias:\n1-Como mi papá de pequeños no nos dio el apellido pues todos en el entorno decían que el no me quería.\n2-El dinero es difícil de conseguir.\n3-Los ricos únicos que pueden ser ricos son los que nacen con dinero.','Una mujer directa , Una mujer leal , una Mujer Proactiva, que siempre busca cómo solucionar.','Mi visión es transformar mi vida multidireccional específicamente a nivel mental, espiritual,finaciera  y con ese ímpetu poder ayudar inspirar y transformar vidas de mujeres, madres multidireccionalmente con mi negocio con mi testimonio con mi trasnformacion y poder guiarlas a buscar la mejor herramientas para transformar su vida.','Al final de mi vida una meta importante para mi pues haber alcanzado la salvación en tema espiritual en lo terrenal haber dejado un legado para el mundo.\n\nMi familia Diría sobre mi relación con ellos que soy poca afectiva pero con una sonrisa siempre.\n\nMis amigos dirían sobre mi relación con ellos que existe mucho respeto por las desiciones que cada uno toma , que siempre estoy para escuchar ,también que pues soy leal sin barreras.','Mi primera meta considerando la distinción ser-hacer-tener sería , ser intencional con todo lo que hago , en este caso con mi relación con Dios , con el tiempo de dedicarle a la oración a la lectura al silencio a estar presente y es una Meta merezco tener viva todos los días de mi vida','Tratar a mi madre y mi padre como me fascinaría que lo hicieran.','No sabotear mi palabra de ninguna manera respetar mis propios compromisos conmigo misma',1,'2023-07-17 20:55:30','2023-07-17 20:55:30'),(5,480,14,'Mama, Papa, Gaby (hermana), Juanky (primo), Isaias (amigo), Tapia (amigo), Jan (amigo)','Isabella 15, Sarah 10, Eva 3','Annabella (esposa), Isabella (hija), Sarah (hija), Eva (hija), Luz Marina (domestica)','Católicos no practicantes','No hice servicio militar','ingeniero electromecánico certificado como administrador energético. Brindo servicios de consultoría energética especializada.','Primaria Secundaria (La Salle) Bachiller en Ciencias y Letras con Licenciatura en Ingeniería','APB, AEE, IEEE','Me encuentro bien de salud.','Alto calvo ojos claros flaco','No se','Tipazo','Seguir disfrutándola y aprendiendo','1. Desearía ser Libre Económicamente hablando. 2. Mi Familia Saludable para disfrutarlos y compartir\n3. Que la valoran mucho, siempre me lo dicen','Convertirme en un mejor líder 