ola voz.','Reservada, observadora.','Mi vision para mi vida es:\nRecibir mi ascenso laboral,\nTener mi casa lista y poder mudarme.\nViajar.\nRetirarme a disfrutar mi familia...','Cancelado mi casa ..\nHaber viajado .\nMi familia diria que soy muy sobre-protectora.\nMis amigos que soy muy leal y cariñosa.','Adquirir mayor confianza en mi misma.','Ascenso laboral.','Amueblar mi casa.',1,'2023-07-17 23:47:05','2023-07-17 23:47:05'),(10,443,14,'Mi relación con mi abuelo, quien fue mi figura paterna. Mi abuela y mi madre, mi primo quien falleció ahogado, mi primer novio secreto de adolescencia, mi primer novio oficial, mi ex marido, mi amiga que me enroló y mi mejor amiga que es como mi hermana.','No','Madre Aleyda. Padrastro Marco','Fui sobreprotegida al punto de no tener amigos, ni salir de casa con nadie, tenía mucho miedo al entorno fuera del familiar, fuera de casa y a los extraños. Me inculcaron el catolicismo, sin embargo desde los 5años hasta mis 11años estuve en un colegio bautista lo que me generó muchas preguntas y a questionario la religión como tal, luego con mi ex marido conocí de los evangélicos a leer la biblia y fui creciendo en mi fé, mutando en ella con un giro hebreo y al día de hoy no me concidero religiosa más si creo en el Dios de los Hebreos, El Dios de Israel.','No','Soy independiente. Mi trabajo consiste en el mercadeo y publicidad como Modelo, impulsadora de marca.','Diplomados, cursos y seminarios de Actuación, Locución, Voz y dicción, Baile\nUniversitaria Licenciatura\nCursos y seminarios complementarios a mi licenciatura \nGrado completo de escolaridad','Ninguna','Controlado. Con revisiones anuales.\nLevotiroxina diario\nVitaminas & Suplementos prescristas por deficiencias diarias. Desde vitamina D3, magnesio, zinc, vitamina B, A, E, C, biotina, omega 369, ácido folico, probioticos, encimas digestivas','Delgada, pequeña, de tez blanca, cabello y ojos castaño oscuro.','Cuando me enteré que mi abuelo no era mi papá. \nCuando me mudé con mi mam