rsonas que puedo ayudarlos a costo de nada',0,'2023-08-14 13:59:32','2023-08-14 13:59:32'),(13,695,15,'Estar presente en los momentos en los que comparto con mis seres queridos.','Mejorar mi relación con mi papá y sanar las heridas emocionales que cargo desde hace años','Hablar fluidamente inglés','Terminar mi maestría en inteligencia artificial','Aportar a las fundaciones animalistas de manera más activa','Iniciar un cambio o mejora a nivel de conservación para las ballenas jorobadas del pacifico (es parte de mi proyecto de grado de maestría)',0,'2023-08-14 17:03:07','2023-08-14 17:03:07'),(14,796,15,'Mejor mi carácter al momento de enfrentar mis problemas personales con mi padre.','Afrontar los obstáculos con mente fría sin exsaltarme.','Aprende a no responder cuando me llaman la atención en mi trabajo cuando no tengo la culpa.','N/A','No','N/A',0,'2023-08-14 18:14:05','2023-08-14 18:14:05'),(15,730,15,'Al final de este curso mi objetivo es establecer una base sólida en la relación con mis padres, demostrar que cuentan con mi apoyo siempre a lo que ellos requieran','Crear vínculos más fuertes con los seres que me rodean constantemente es importante para mi, saber entender sus comportamientos es fundamental','Aplicar lo dado es este curso para mejorar mi manera de Interactuar con mis compañeros y colaboradores. Haciendo énfasis en mi lenguaje y comportamiento','Que lo aprendido me entusiasme a no rendirme y poder alcanzar mis metas, ver la universidad desde el punto de vista como algo que me entusiasma.','Saber identificar los problemas que surgen en mi comunidad y poder participar en las soluciones','Poder tener un vínculo más fuerte y involucrarme más',0,'2023-08-14 20:18:07','2023-08-14 20:18:07'),(16,752,15,'Tener mas autconfianza en mi\nTener serenidad en momentos tensos \nLlevarme bien con las personas \nSuperar errores pasados \nTener amor propio \nSuperar la ansiedad \nTener valentía','Mejorar la relación con mis padres \nEducar a mis hijos con respeto y am