ia, servirle a los demás sin esperar nada a cambio , ayudar a otras personas en necesidad.','Poder impactar positivamente con mi proyecto de vida',1,'2023-08-15 05:02:01','2023-08-15 05:02:01'),(19,728,15,'Me gustaría no sentirme asustada cuando voy a contarles algo a mi familia sin importar si es malo o bueno. Muchas de veces mi toma de decisión va ligada a lo que ellos vayan a pensar o decir.','Aprender a ponerme a mi y mis responsabilidades de prioridad sin importar que vaya a herir a los demás.','Adquirir la mayor cantidad de experiencia para poder definir cuál es mi área de mayor interés','Subir mi índice y realmente aprender lo que se dicta en las clases','No sentirme débil cuando una persona tiene más conocimiento que yo. Muchas veces dudo de mi capacidad solo con ver que la persona tiene más experiencia que yo.','Ser una persona de impacto y que las personas confíen en mi',0,'2023-08-15 13:15:17','2023-08-15 13:15:17'),(20,754,15,'Trabajar en mis emociones amorosas/afectivas. constantemente me siento aturdido y con ansiedad por la manera en que llevo las relaciones y los intentos de relaciones de pareja, eso ocasiona que pase días deprimido y sintiéndome inferior y poco capaz de llevar una relación de pareja por lo que quiero lograr aprender a trabajar estas emociones y de esta manera pueda estar preparado para recibir amor y recibir a una pareja que tenga los mismos intereses que yo.','Sanar muchos temas internos relacionados con mi crianza y con patrones de conducta que sigo repitiendo que viene relacionado con mi niño interior.','Aprender a manejar mis finanzas de una manera consiente, por lo descrito anteriormente, busco Estar presente en cualquier evento/fiesta/reunión para intentar estar en el radar de las personas y sentir que tengo una vida social muy activa, y eso genera que gaste demasiado dinero innecesario y que llene un vacío con algo que me genera desequilibrarme económicamente.','aprender herramientas que me ayuden en el dia a dia tanto en el 