eguir una mejor fuente de ingreso','Tener un entorno mejor','Seguir llevando una buena relación con la  comunidad',0,'2023-08-16 16:09:25','2023-08-16 16:09:25'),(31,764,15,'Quiero aprender no estresar y no gritar con gente que importante para mi, poder controlar mi parte emocional','Soy de otro país, vivo en Panamá 4 años y todavía no tengo ni amigos ni novia ni nadie, quiero reparar esa parte','Quiero tener mi parte emocional más controlada y usar más cabeza que emociones','Quiero tener más atención en mi y en mi trabajo que en momentos que me molestan y hacen triste o enojado','Quiero aprender recibir gente como son y no estresar por raspbes que no importan (ej. en la calle de cómo manejan o algo así)','Quiero que gente no tienen miedo de tener amistad o alguna relación conmigo',0,'2023-08-16 17:06:39','2023-08-16 17:06:39'),(32,721,15,'Mi madre, merece atención. Deseo tener más conexión con ella','Mi hija, brindar tiempo de calidad','Crecimiento profesional exitoso logrando buenos resultados positivos','Dar el ejemplo al resto de los compañeros.','Ser un ejemplo a seguir','influir en los demás de forma positiva',0,'2023-08-16 17:25:04','2023-08-16 17:25:04'),(33,672,15,'Fortalecer mi confianza hacia mi familia sobre temas personales','Ser más sociable con compañeros y personas que no conozco','Poder descubir y aprovechar mis habilidades para tener mi propio negocio en un futuro','Saber manejar el estrés y poder seguir adelante','Llegar a ser una persona ejemplar en las que las personas puedan confiar y ser capaz de ayudarlas','Participar en eventos que promuevan el conocimiento y así fortalecer a la comunidad',0,'2023-08-16 17:27:24','2023-08-16 17:27:24'),(34,713,15,'Conocer y relacionarme con gente nueva','Hacer más actividades en familia','Crear varias fuentes de ingreso distintas','Aplicar para una mejor posición laboral','Participar en más actividades comunitarias','Aportar y ser ejemplo para otros miembros del la comunidad',0,'2023-08-16 19:23:42','2023-08-16 19:23:42'),(35,586,15,'Darle una buena calidad de vida a mi familia','Poder sanar sus condiciones de salud','Generar grandes ingresos y poder volver a tener mis propios negocios sin ser un autoempleado y poder disfrutar de mi vida y ser feliz','Quisiera ser un exitoso multi billonario sin tener que ser esclavo \nPoder estudiar y aprender todo lo referente a todos los negocios y poder generar muchas plazas de empleo para las personas que me rodean','Me gustaría aportar cosas positivas a la comunidad para que esta cada vez sea mejor','Dejar un buen legado,  un ejemplo a seguir que inspire a otras personas y futuras generaciones',1,'2023-08-16 19:30:36','2023-08-16 19:30:36'),(36,814,15,'Meta construir un negocio para el beneficio de toda la familia','Tener facilidad de tener una buena relacion de comunicacion con familia y amigo.','Tener un buen desempeño en el ambito laboral dentro de mi funciones','Iniciar otra carrera de estudio para mejorar mi habilidad y desempeño','Crear una cultura de identidad en los jovenes y niños','Aplicar conocimiento adquirido en la comunidad para que sean autosostenible.',0,'2023-08-16 19:56:12','2023-08-16 19:56:12'),(37,778,15,'Lograr un mayor amor propio, auto estima y seguridad a fin de sentir felicidad y alegria compartiendo ese amor con mi familia y seres queridos','Obtener una mayor autoconfianza que enriquezca mis relaciones interpersonales a fin de que se multipliquen en cantidad y calidad humana','Enfocarme y desarrollarme como profesional que aporte a mi entorno laboral logrando mucho mayor crecimiento en mi trabajo','Iniciar un programa de perfeccionamiento de mis habilidades y capacidades intelectuales que enriquezca mí portafolio como profesional','Ser más participativo en el aporte a de ideas y acciones que beneficien a mi entorno social','Integrarme en distintos grupos o ong en los que participe y pueda aportar en acciones que beneficien a otras personas o al entorno en general',0,'2023-08-16 20:42:52','2023-08-16 20:42:52'),(38,811,15,'Quiero mejorar mis relación con mi familia, no ser tan amargado','Quiero poder conseguir amistades en las que den lo que yo les doy.','Quiero hacer crecer mi negocio y tener más seguridad en mí para llevar el proyecto.','Quiero sacar más tiempo para estudiar y avanzar en mi educación','Siempre me ha gustado brindar ayuda pero luego de emigrar perdí esa vocación me gustaría retomarla','Ser más sociable con mi entorno.',0,'2023-08-16 21:02:31','2023-08-16 21:02:31'),(39,700,15,'Unión familia primaria: madre y hermanos','Despreocuparme por mi soltería','Armonizar la diversidad de labores que realizo.','Comprender y aceptar a  mis compañeros trabajo.','Comprender y aceptar esa misión del trabajo altruista.','No estresarme por los resultados',0,'2023-08-16 21:21:10','2023-08-16 21:21:10'),(40,703,15,'Tener una mejor comunicación familiar','Ser mejor persona cm pareja','Como ser un buen o mejor líder con mi empresa y grupo d trabajo','Ser cada día mejor en lo que hago','Me gustaría aprender a entender a las demás personas','Saver cm poder hablarle a las demás personas',0,'2023-08-16 21:29:12','2023-08-16 21:29:12'),(41,686,15,'Mejorar la relación que tengo con mi papá, crear un vínculo de amor. Ya que desde pequeña el nunca aprendió a controlar sus emociones y siempre a sido agresivo','Mejorar la relacioj con mi familia, aprender amar ser más unida','Realizar cursos, llenarme de conocimientos, aprender varios oficios y poder ser mi propio jefe','Terminar mi carrera universitaria, no la he culminado ya que viaje acá a Panamá y llegué solo a 4to semestre','Poder ayudar a las personas cuando tenga buena posición económica, ayudar a mi familia y amigos a poder crecer como personas.','Crear grupos de apoyos para adolescentess y hablarles de cómo poder organizar su dinero como administrarlo.',0,'2023-08-16 21:49:29','2023-08-16 21:49:29'),(42,744,15,'Tener una familia plena donde ahiga amor, respeto, armonía, paz y comunicación','Que mi familia sea prioridad y que ahiga.           crecimiento en todos los aspectos quiero tener una familia con principios con educación de tal manera que mis hijos el día de mañana puedan trasmitir ese amor educación a sus hijos el día de mañana','En mi trabajo me gustaría ser el mejor de tal manera que pueda hacer mi trabajo de forma eficiente lograr crecer y escalar','Retomar mis estudios y estudiar una carrera  donde pueda aprovechar mis conocimiento adquirido basado en mi oficio','Ser mejor persona de tal forma que podría ayudar a mi comunidad siendo una persona contributiva compartiendo idea aciendo amistades','Compartiendo este seminario',0,'2023-08-16 22:23:33','2023-08-16 22:23:33'),(43,751,15,'Aprender a manejar mis emociones en el entorno familiar.','Aprender a no cargar con el peso de problemas que no me corresponden.','Mejorar mis habilidades sociales.','Ser más organizado con las responsabilidades laborales.','Generar empatía y amabilidad con las personas','Fomentar el positivismo ante situaciones que parecen no tener solución',0,'2023-08-16 22:26:05','2023-08-16 22:26:05');
