INSERT INTO `forminduccions` VALUES (4,598,'Vivo con mi hija, tenemos una muy linda relacion. Mi mama y mi hermana viven en venezuela y nos llevamos muy bien excelente gracias a Dios. Solo tengo problemas con mis relaciones de pareja pero ahorita estoy separada.','La verdad me veo soltera aun al final de este proceso porque quiero primero estar bien segura de que es lo que quiero','Hago un poco de ejercicio a veces en el parque o a veces en el gym, voy al trabajo es donde paso mas tiempo y ahora mismo estoy en varias capacitaciones ademas de la de ustedes pero refebtes a mi trabajo son 3 un curso de microblanding, una de camuflahe de estrias y una de administracion y mejora de negocios.','Me veo cumplida con todas mis capacitaciones y con un negocio mas organizado y estable','Tengo un pequeño negocio una estetica. Estoy em proceso de cambiarme a un local mas grande debido que en el que estoy se me quedo pequeño y sobre todo organizarme mejor a nivel administrativo y legal.','No tengo buena administracion y no todo esta en regla','Llegar una excelente addministracion del negocio, colocar todo en regla legalmente, estabilizar economicamente el negocio.','Aprender ingles','Tener una casa propia',0,'2023-07-26 17:55:54','2023-07-26 17:55:54',17),(5,438,'Tengo algunos problemas con mi esposa, debido a mi caja de creencias, Estoy casado, soy caficultor, vivo con mi esposa, mi hija y mi mamá, las personas mas importante de mi entorno son mi esposa, mi hija y mi mamá','me veo salvando mi matrimonio y familia','voy a la finca de cafe y al gym cuando estoy en boquete y cuando estoy en la ciudad me encargo de mi hija','sacando el mayor provecho de la finca, en desarrollar el cultivos de hortalizas, como otra forma de ingreso, ya que el principal es el cultivo del cafe.\nsiguiendo entrenando para tener una buena salud física','es estable, es la de ser mas entregado, comprometido y dedicado en las cosas que realizo en mi trabajo','el haber perdido el amor, la entrega y la dedica